/*Table structure for table `course_teacher` */

DROP TABLE IF EXISTS `course_teacher`;

CREATE TABLE `course_teacher` (
  `course_id` int(10) unsigned NOT NULL,
  `faculty_id` int(10) unsigned NOT NULL,
  `year` year(4) NOT NULL,
  `semester` int(10) unsigned NOT NULL,
  PRIMARY KEY  (`course_id`,`faculty_id`,`year`,`semester`),
  KEY `faculty_id` (`faculty_id`),
  CONSTRAINT `course_teacher_ibfk_1` FOREIGN KEY (`course_id`) REFERENCES `course_record` (`course_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `course_teacher_ibfk_2` FOREIGN KEY (`faculty_id`) REFERENCES `faculty_record` (`faculty_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `course_teacher_ibfk_3` FOREIGN KEY (`course_id`) REFERENCES `course_record` (`course_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `course_teacher_ibfk_4` FOREIGN KEY (`faculty_id`) REFERENCES `faculty_record` (`faculty_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `course_teacher` */

