/*Table structure for table `replacement_table` */

DROP TABLE IF EXISTS `replacement_table`;

CREATE TABLE `replacement_table` (
  `student_id` int(10) unsigned NOT NULL,
  `old_course_id` int(10) unsigned NOT NULL,
  `new_course_id` int(10) unsigned NOT NULL,
  `course_type_id` int(10) unsigned default '0',
  PRIMARY KEY  (`student_id`,`old_course_id`,`new_course_id`),
  UNIQUE KEY `student_id` (`student_id`,`new_course_id`),
  KEY `old_course_id` (`old_course_id`),
  KEY `new_course_id` (`new_course_id`),
  KEY `course_type_id` (`course_type_id`),
  CONSTRAINT `replacement_table_ibfk_1` FOREIGN KEY (`student_id`) REFERENCES `main_student_record` (`student_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `replacement_table_ibfk_2` FOREIGN KEY (`old_course_id`) REFERENCES `course_record` (`course_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `replacement_table_ibfk_3` FOREIGN KEY (`new_course_id`) REFERENCES `course_record` (`course_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `replacement_table_ibfk_4` FOREIGN KEY (`course_type_id`) REFERENCES `course_type_record` (`course_type_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `replacement_table` */

