/*Table structure for table `spi_cpi_record` */

DROP TABLE IF EXISTS `spi_cpi_record`;

CREATE TABLE `spi_cpi_record` (
  `student_id` int(10) unsigned NOT NULL,
  `year` int(10) unsigned NOT NULL,
  `semester` int(10) unsigned NOT NULL,
  `spi` float NOT NULL,
  `cpi` float NOT NULL,
  PRIMARY KEY  (`student_id`,`year`,`semester`),
  CONSTRAINT `spi_cpi_record_ibfk_1` FOREIGN KEY (`student_id`) REFERENCES `main_student_record` (`student_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `spi_cpi_record` */

/*Table structure for table `strength_record` */

DROP TABLE IF EXISTS `strength_record`;

CREATE TABLE `strength_record` (
  `department_id` int(10) unsigned NOT NULL,
  `programme_id` int(10) unsigned NOT NULL,
  `year` int(10) unsigned NOT NULL,
  `sanctioned_strength` int(10) unsigned NOT NULL,
  `admitted_strength` int(10) unsigned NOT NULL default '0',
  `current_strength` int(10) unsigned NOT NULL default '0',
  PRIMARY KEY  (`programme_id`,`department_id`,`year`),
  KEY `department_id` (`department_id`),
  CONSTRAINT `strength_record_ibfk_1` FOREIGN KEY (`department_id`) REFERENCES `department_record` (`department_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `strength_record_ibfk_2` FOREIGN KEY (`programme_id`) REFERENCES `programme_record` (`programme_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `strength_record` */

/*Table structure for table `student_grades` */

DROP TABLE IF EXISTS `student_grades`;

CREATE TABLE `student_grades` (
  `student_id` int(10) unsigned NOT NULL,
  `course_id` int(10) unsigned NOT NULL,
  `year` int(10) unsigned NOT NULL,
  `semester` int(10) unsigned NOT NULL,
  `grade_type_id` int(10) unsigned NOT NULL,
  PRIMARY KEY  (`student_id`,`course_id`,`year`,`semester`),
  KEY `course_id` (`course_id`),
  CONSTRAINT `student_grades_ibfk_1` FOREIGN KEY (`student_id`) REFERENCES `main_student_record` (`student_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `student_grades_ibfk_2` FOREIGN KEY (`course_id`) REFERENCES `course_record` (`course_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `student_grades` */

/*Table structure for table `student_record` */

DROP TABLE IF EXISTS `student_record`;

CREATE TABLE `student_record` (
  `student_id` int(10) unsigned NOT NULL,
  `programme_id` int(10) unsigned NOT NULL,
  `department_id` int(10) unsigned NOT NULL,
  `start_date` date NOT NULL,
  `end_date` date NOT NULL,
  PRIMARY KEY  (`student_id`,`programme_id`,`department_id`),
  UNIQUE KEY `student_id` (`student_id`),
  KEY `programme_id` (`programme_id`),
  KEY `department_id` (`department_id`),
  CONSTRAINT `student_record_ibfk_1` FOREIGN KEY (`student_id`) REFERENCES `main_student_record` (`student_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `student_record_ibfk_2` FOREIGN KEY (`programme_id`) REFERENCES `programme_record` (`programme_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `student_record_ibfk_3` FOREIGN KEY (`department_id`) REFERENCES `department_record` (`department_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

