/*Table structure for table `student_registration` */

DROP TABLE IF EXISTS `student_registration`;

CREATE TABLE `student_registration` (
  `student_id` int(10) unsigned NOT NULL,
  `course_id` int(10) unsigned NOT NULL,
  `year` int(10) unsigned NOT NULL,
  `semester` int(10) unsigned NOT NULL,
  `course_type_id` int(10) unsigned NOT NULL,
  `faculty_approval` int(10) unsigned default '0',
  PRIMARY KEY  (`student_id`,`course_id`,`year`,`semester`),
  KEY `course_id` (`course_id`),
  KEY `course_type_id` (`course_type_id`),
  CONSTRAINT `student_registration_ibfk_1` FOREIGN KEY (`student_id`) REFERENCES `main_student_record` (`student_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `student_registration_ibfk_2` FOREIGN KEY (`course_id`) REFERENCES `course_record` (`course_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `student_registration_ibfk_3` FOREIGN KEY (`course_type_id`) REFERENCES `course_type_record` (`course_type_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

